import React, { useState, useEffect } from 'react';
import Buttons from './components/Buttons'

import axios from 'axios';

import './App.css';

function App() {
  const [count, setCount] = useState(0);
  const [data, setData] = useState([]);

  useEffect(() => {
    axios.get('http://localhost:5000/Ingredients')
      .then(res => {
        console.log(res.data)
        setData(res.data)
      })
  }, [])

  return (
    <div>
      {data.map(data =>
        <div key={data.id}>
          <p>{data.ingredientName}  <button onClick={() => setCount(count + 1)}>+</button> {count} <button onClick={() => setCount(count - 1)}>-</button></p>
        </div>)}
    </div>

  );
}

export default App;
